export const loadPosts = async () => {
  try {
    const res = await axios.get("/api/v1/posts");

    const postMarkup = res.data
      .map((postData) => {
        return generatePostMarkup(postData);
      })
      .join("");

    postsContainer.innerHTML = postMarkup;
  } catch (error) {
    console.log(error);
  }
};
